DROP TABLE IF EXISTS `keke_user`;
CREATE TABLE `keke_user` (
  `id` bigint(11) NOT NULL,
  `username` varchar(100) NOT NULL,
  `account` varchar(100) NOT NULL,
  `password` varchar(100) DEFAULT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `header_pic` varchar(200) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `is_delete` int(1) DEFAULT NULL,
  `age` int(3) DEFAULT NULL,
  `male` int(1) DEFAULT NULL,
  `active` int(1) DEFAULT NULL,
  `sign` varchar(600) DEFAULT NULL,
  `url` varchar(100) DEFAULT NULL,
  `gcount` int(11) DEFAULT '0',
  `fans` int(11) DEFAULT '0',
  `type` int(1) DEFAULT NULL COMMENT '1 普通会员  2：老师  3：课程会员  4：超级会员',
  `idcard` varchar(20) DEFAULT NULL,
  `salary` varchar(10) DEFAULT NULL,
  `email` varchar(200) DEFAULT NULL,
  `jifen` int(11) DEFAULT NULL,
  `contribution` int(11) DEFAULT NULL,
  `level` int(11) DEFAULT NULL,
  `cron` int(11) DEFAULT NULL,
  `address` varchar(400) DEFAULT NULL,
  `job` varchar(100) DEFAULT NULL,
  `intro` varchar(1000) DEFAULT NULL,
  `userdesc` varchar(1000) DEFAULT NULL,
  `weixin` varchar(200) DEFAULT NULL COMMENT '用户微信',
  `openid` varchar(200) DEFAULT NULL,
  `city` varchar(20) DEFAULT NULL,
  `province` varchar(50) DEFAULT NULL,
  `language` varchar(10) DEFAULT NULL,
  `country` varchar(50) DEFAULT NULL,
  `roleid` int(1) DEFAULT NULL COMMENT '1普通 2 营销人员 3 管理员',
  `uuid` bigint(20) DEFAULT NULL,
  `version` int(11) DEFAULT NULL,
  `bgimg` varchar(255) DEFAULT NULL,
  `advice` text,
  PRIMARY KEY (`id`),
  UNIQUE KEY `index_uuid` (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

